        public void SendServerTime(ClientSession cs)
        {
            DateTime d1;
            DateTime d2;
            TimeSpan d3;
            int timeStamp = 0;

            d1 = DateTime.Parse("1970-01-01 09:00:00");
            d2 = DateTime.Now;
            d3 = d2 - d1;
            timeStamp = Convert.ToInt32(d3.TotalSeconds);

            using (OutPacket oPacket = new OutPacket(GameOpcodes.EVENT_SERVER_TIME_NOT))
            {
                oPacket.WriteInt(timeStamp);
                oPacket.WriteInt(d2.Year);
                oPacket.WriteInt(d2.Month);
                oPacket.WriteInt(d2.Day);
                oPacket.WriteInt(d2.Hour);
                oPacket.WriteInt(d2.Minute);
                oPacket.WriteInt(d2.Second);

                oPacket.Assemble(cs.CRYPT_KEY, cs.CRYPT_HMAC, cs.CRYPT_PREFIX, ++cs.CRYPT_COUNT);
                cs.Send(oPacket);
            }
        }

