        public struct HeroDungeon
        {
            public int HeroID;
            public int Open;
            public int MaxLevel;
            public int MinLevel;
            public int Played;
            public int MaxPlay;
            public HeroHours[] herohours;
        }

        public HeroDungeon[] herodungeon= new HeroDungeon[0];

        public void LoadHero()
        {            
            DataSet ds = new DataSet();
            Database.Query(ref ds, "SELECT  * FROM  `gc`.`hero`ORDER BY HeroID ASC");
            Array.Resize(ref herodungeon, ds.Tables[0].Rows.Count);
            for (int a = 0; a < ds.Tables[0].Rows.Count; a++)
            {
                herodungeon[a].HeroID= Convert.ToInt32(ds.Tables[0].Rows[a]["HeroID"].ToString());
                herodungeon[a].Open = Convert.ToInt32(ds.Tables[0].Rows[a]["Open"].ToString());
                herodungeon[a].MaxLevel = Convert.ToInt32(ds.Tables[0].Rows[a]["MaxLevel"].ToString());
                herodungeon[a].MinLevel= Convert.ToInt32(ds.Tables[0].Rows[a]["MinLevel"].ToString());
                herodungeon[a].Played = Convert.ToInt32(ds.Tables[0].Rows[a]["Played"].ToString());
                herodungeon[a].MaxPlay = Convert.ToInt32(ds.Tables[0].Rows[a]["MaxPlay"].ToString());
                DataSet ds2 = new DataSet();
                Database.Query(ref ds2, "SELECT   * FROM  `gc`.`herohours` WHERE `HeroID`='{0}'", herodungeon[a].HeroID);
                Array.Resize(ref herodungeon[a].herohours, ds2.Tables[0].Rows.Count);
                for (int b = 0; b < ds2.Tables[0].Rows.Count; b++)
                {
                    herodungeon[a].herohours[b].Begin = Convert.ToInt32(ds2.Tables[0].Rows[b]["Begin"].ToString());
                    herodungeon[a].herohours[b].End = Convert.ToInt32(ds2.Tables[0].Rows[b]["End"].ToString());
                }
            }
        }

        public void SendHeroDungeonInfo(ClientSession cs)
        {
            using (OutPacket oPacket = new OutPacket(GameOpcodes.EVENT_HERO_DUNGEON_INFO_NOT))
            {
                LoadHero();
                oPacket.WriteInt(362080);
                oPacket.WriteInt(herodungeon.Length);
                for (int a = 0; a < herodungeon.Length; a++)
                {
                    oPacket.WriteInt(herodungeon[a].HeroID);//00 00 00 3F
                    oPacket.WriteInt(herodungeon[a].Open);//00 00 00 01
                    oPacket.WriteInt(herodungeon[a].MaxLevel);//00 00 00 1E
                    oPacket.WriteByte((byte)herodungeon[a].Played);//00
                    oPacket.WriteByte((byte)herodungeon[a].MaxPlay);//02
                    oPacket.WriteInt(herodungeon[a].herohours.Length);//00 00 00 11
                    for (short b = 0; b < herodungeon[a].herohours.Length; b++)
                    {
                        oPacket.WriteShort(b);//00 00
                        oPacket.WriteInt(herodungeon[a].herohours[b].Begin);//57 F0 B0 70
                        oPacket.WriteInt(herodungeon[a].herohours[b].End);//57 F0 B7 78
                    }
                    oPacket.WriteHexString("00 00 00 00 00 00 00 00 00 00 00 00 00 00 00 11");
                }
